import Box from '@mui/material/Box';
import { fetchAuth, selectName, logout, selectIsAuth, fetchRegistration } from '../../redux/slices/auth';
import { TextField } from '@mui/material';
import { Link, redirect } from 'react-router-dom';
import { useRef, useState } from 'react';
import React from 'react'
import { useForm } from 'react-hook-form'
import { useDispatch } from 'react-redux';
import iconSet from '../../styles/icons/selection2.json'
import IcomoonReact from 'icomoon-react';
import { useNavigate } from "react-router-dom";
import iconSet4 from '../../styles/icons/selection4.json'

import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select, { SelectChangeEvent } from '@mui/material/Select';

function CreateForm() {

   const navigate = useNavigate();

   const {
      register: register2,
      formState: { errors: errors2, isValid: isValid2 },
      handleSubmit: handleSubmit2,
   } = useForm({
      defaultValues: {
         text: '',
         title: '',
         place: '',
         price: '',
         tag: '',
      }
   })

   const onSubmit2 = async (values) => {
      const data = await dispatch(fetchRegistration(values))

      if (!data.payload) {
         return alert("Не удалось зарегистрироваться. Скорее всего, ваш пароль слишком короткий или аккаунт с подобной электронной почтой уже существует")
      }
      redirect("/profile")
      if ('token' in data.payload) {
         window.localStorage.setItem('token', data.payload.token)
         navigate("/");
      }
   }


   const [age, setAge] = React.useState('');

   const handleChange = (event) => {
      setAge(event.target.value);
   };

   const dispatch = useDispatch()

   return (
      <>
         <div className="fullscreen__registration registration">
            <form onSubmit={handleSubmit2(onSubmit2)} className="login__form login__form_creating">
               <div className="registration__title">
                  Создание статьи
               </div>
               <Box mb={"20px"}>
                  <TextField
                     label="Название товара"
                     type="title"
                     className='password-textfield'
                     fullwidth
                     error={Boolean(errors2.fullName?.message)}
                     {...register2('title', { required: "Укажите название товара" })}
                  />
               </Box>
               <Box mb={"20px"}>
                  {/* <TextField
                     label="Почта"
                     type="email"
                     className='email-textfield'
                     fullwidth
                     error={Boolean(errors2.email?.message)}
                     {...register2('email', { required: "Укажите почту" })}
                  /> */}
                  <TextField
                     className='email-textfield'
                     id="outlined-multiline-static"
                     label="Информация о товаре"
                     type="text"
                     multiline
                     rows={4}
                     // defaultValue="Default Value"
                     error={Boolean(errors2.text?.message)}
                     {...register2('text', { required: "Напишите что-то о товаре" })}
                  />
               </Box>
               <Box mt={"20px"}>
                  <TextField
                     label="Населенный пункт"
                     type="place"
                     className='password-textfield'
                     fullwidth
                     error={Boolean(errors2.place?.message)}
                     {...register2('place', { required: "Укажите ваше место находения" })}
                  />
               </Box>
               <FormControl fullWidth>
                  <InputLabel id="demo-simple-select-label">Age</InputLabel>
                  <Select
                     className='password'
                     labelId="demo-simple-select-label"
                     id="demo-simple-select"
                     value={age}
                     label="Age"
                     onChange={handleChange}
                  >
                     <MenuItem value={10}>Ten</MenuItem>
                     <MenuItem value={20}>Twenty</MenuItem>
                     <MenuItem value={30}>Thirty</MenuItem>
                  </Select>
               </FormControl>
               {/* <Box mb={"20px"} mt={"20px"}>
                  <TextField
                     label="Раздел"
                     type="password"
                     // className="login__name"
                     className='password-textfield'
                     fullwidth
                     // helperText={errors.password?.message}
                     error={Boolean(errors2.password?.message)}
                     {...register2('password', { required: "Укажите пароль" })}
                  />
               </Box> */}
               <button type='submit' class="login__button"><span>Зарегистрироваться</span></button>
               <div class="login__bottom">Если вы уже имеете аккаунт, вы можете <Link to={'/auth'} class="logo-link" relative="path">
                  <span class="login__redirect popup-link">авторизироваться</span>
               </Link></div>
            </form>
            <div className="registration__icon">
               <IcomoonReact iconSet={iconSet4} color="#5EA93A" size={400} icon="clipboard-edit1" />
            </div>
         </div>
      </>
   )
}
export default CreateForm
